(1, 'iOS 12 &amp; Swift - The Complete iOS App Development Bootcamp', 'The study adopted social learning theory proposed by Bandura (1977) which has the behaviour of children as its focus. ', 'The\r\nstudy adopted social learning theory proposed by Bandura (1977) which has the\r\nbehaviour of children as its focus. The theory suggests that behaviour is\r\ndetermined primarily by the people around an individual. The theory holds that\r\nmost human behaviour is learned observationally through modelling. From\r\nobserving others, one forms an idea of how new behaviours are performed and, on\r\nlater occasions, this coded information serves as a guide for action. Children\r\nattempt to internalize the conduct of other people and acquire behaviour\r\npatterns that are similar to those people<br><br><br><br><br>', '["A","B","C","D"]', 'english', 1, 2, '[1]', '["AA","BB","CC","DD","EE"]', 50, NULL, 0, 'advanced', 1, NULL, 'youtube', 'youtube', 1549929600, NULL, NULL, 1, 1, 'active', '', 'meta description');
